import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Wait for the product cards to be rendered by the script
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.waitForSelector('.product-price', { timeout: 5000 });

    // Take a screenshot after products are loaded
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_loaded.png'));

    // Extract all product prices
    const allPrices = await page.$$eval('.product-price', (elements) =>
      elements.map((el) => {
        // The text content might include the original price, e.g., "$59.50 $79.99"
        // We split by space and take the first part, which is the current price.
        const priceText = el.textContent.trim().split(' ')[0];
        // Remove the '$' and convert to a number
        return parseFloat(priceText.replace('$', ''));
      })
    );

    return {
      success: true,
      action: "Extracted all product prices from the page.",
      extractedData: {
        productPrices: allPrices,
        priceCount: allPrices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    screenshots.push(path.join(screenshotsDir, 'error_screenshot.png'));

    return {
      success: false,
      action: "Failed to extract product prices.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
